```
Here's what's changed:

1. We added a new state variable `lastRun` to keep track of the last time the effect was run.
2. We added a check at the beginning of the effect to see if the current time is less than `DEBOUNCE_DELAY` milliseconds after the last run. If it is, we return immediately without running the effect.
3. We set the `lastRun` state variable to the current time after running the effect.

By doing this, we ensure that the effect can only run once every `DEBOUNCE_DELAY` milliseconds (0.6 seconds in this case).

